import React from 'react'

const Card = ({pokemon}) => {
  return (
     <div className='card'>
            <div className="CardImg">
                <img src={pokemon.sprites.front_default} alt='' />
            </div>
            <h3 className="cardName">{pokemon.name}</h3>
            <div className='cardTypes'>
                <div>
                    タイプ
                    {pokemon.types.map((type) => {
                        return (
                            <div>
                                <span>{type.type.name}</span>
                            </div>
                        );
                    })}
                </div>

            </div>
          </div>
  );
};

export default Card;
